<script src="/main.af46ece4.js"></script></head>

<body>



    <div id="outlet"></div>
    <style>#outlet>.leaving {
            animation: 1s fadeOut ease-in-out;
        }
        
        #outlet>.entering {
            animation: 1s fadeIn linear;
        }
        
        @keyframes fadeOut {
            from {
                opacity: 1;
            }
            to {
                opacity: 0;
            }
        }
        
        @keyframes fadeIn {
            from {
                opacity: 0;
            }
            to {
                opacity: 1;
            }
        }</style>
    <script src="/init.9d6cb373.js"></script>

</body>

</html>
